import Benner from "../../component/Benner";
import Footer from "../../component/Footer";
import Navbar from "../../component/Navbar";
import Services from "../../component/Services";

const Home = () => {

    return (
       <div>
    
        <Navbar/>
        <Benner/>
        <Services/>
        <WhyUs/>
        <Footer/>
       </div> 
    )
}

export default Home;
